import React, { Component } from 'react';
import '../scss/Home.scss';

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <header className="Home-header">
          <h1 className="Home-marquee">
            <span>Nelson Chang Nelson Chang Nelson </span>
            <span>Chang Nelson Chang Nelson Chang </span>
          </h1>
          <h2 className="Home-marquee">
            <span>Portfolio Portfolio Portfolio </span>
            <span>Portfolio Portfolio Portfolio </span>
          </h2>
          <h3 className="Home-marquee">
            <span>Under Construction </span>
            <span>Under Construction </span>
          </h3>
        </header>
      </div>
    );
  }
}

export default Home;
